measurements.description:
Seventeen slightly cupped flowers on one 126-cm staked inflorescence; 
  sepals and petals yellow heavily overlaid coral, magenta veins;
   lip white, side lobes spotted burgundy, callus yellow, midlobe burgundy distally, light yellow picotee;
   column cream overlaid burgundy dorsal surface, spotted burgundy ventral surface basally; substance medium;
 texture matte.
